def minPath(grid, k):
    N = len(grid)
    path = [float('inf')] * k
    visited = [[False] * N for _ in range(N)]

    def isValidCell(row, col):
        return 0 <= row < N and 0 <= col < N

    def dfs(row, col, currPath):
        nonlocal path
        if len(currPath) == k:
            if currPath < path:
                path = currPath[:]
            return
        visited[row][col] = True
        for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            newRow, newCol = row + dr, col + dc
            if isValidCell(newRow, newCol) and not visited[newRow][newCol]:
                dfs(newRow, newCol, currPath + [grid[newRow][newCol]])
        visited[row][col] = False

    for row in range(N):
        for col in range(N):
            dfs(row, col, [grid[row][col]])

    return path

def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    seq = [3]
    for i in range(1, n + 1):
        if i % 2 == 0:
            seq.append(1 + i / 2)
        else:
            if i + 1 > len(seq) - 1:
                seq.append(seq[i - 1] + seq[i - 2] + (1 + (i + 1) / 2))
            else:
                seq.append(seq[i - 1] + seq[i - 2] + seq[i + 1])
    return seq

